function fetchDefinition(word_id) {
    //build url
    const app_id = "78ed02b2"
    const app_key = "4647a7d8f6b0d8ad3aed9ca9f7d49c1f"
    const endpoint = "entries"
    const language_code="en_us"

    const url = "https://od-api.oxforddictionaries.com/api/v2/" + endpoint + "/" + language_code + "/" + word_id.lower()

    fetch(url)
        .then(response => response.json())
        .then(term => console.log(term.id))
}

const https = require("https");
const app_id = "<my app_id>";
const app_key = "<my app_key>";
const wordId = "ace";
const fields = "pronunciations";
const strictMatch = "false";
const options = {
   host: 'od-api.oxforddictionaries.com',
   port: '443',
   path: '/api/v2/entries/en-gb/' + wordId + '?fields=' + fields + '&strictMatch=' + strictMatch,
   method: "GET",
   headers: {
     'app_id': app_id,
     'app_key': app_key
   }
 };
https.get(options, (resp) => {
  let body = '';
  resp.on('data', (d) => {
    body += d;
  });
  resp.on('end', () => {
    let parsed = JSON.stringify(body);
    console.log(parsed);
  });
});

export default fetchDefinition;
